var initialView = [5.4536, -73.3539]; // Coordenadas entre Boyacá y Cundinamarca
var initialZoom = 7;

var map = L.map('map', {
    zoomControl: false,
    scrollWheelZoom: false,
    doubleClickZoom: false,
    dragging: false
}).setView(initialView, initialZoom);

// Agregar capa de mapa base
L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
    attribution: '© OpenStreetMap contributors'
}).addTo(map);

// Función para actualizar la información en el contenedor
function updateEcosystemInfo(title, description) {
    var infoContainer = document.getElementById('ecosystem-info');
    infoContainer.innerHTML = `
        <h2>${title}</h2>
        <p>${description}</p>
        <button id="reset-view">Restablecer vista</button>
    `;

    // Evento para restablecer la vista inicial
    document.getElementById('reset-view').addEventListener('click', function () {
        map.setView(initialView, initialZoom); // Restablecer vista y zoom originales
    });
}

